type Personlistprops={
    name:{
        first:string
        last:string
    }[]
}

export const Personlist=(props: Personlistprops)=>{
    return(
        <div style={{color:'blue'}}>
            {props.name.map((name)=>{
             return(
                <h2 key={name.first}>
                    {name.first}
                    {name.last}
                </h2>
             )   
            }
            )}
        </div>
    )
}
